import React from 'react';
import { Container, Card, Button, Row, Col } from 'react-bootstrap';
import networkSecurityImage from "../assets/image-network-security.png"; // Adjust the path as needed

const NetworkSecurity = () => {
  return (
    <Container fluid style={{ height: "100vh" }} className="d-flex align-items-center justify-content-center">
      <Row className="d-flex justify-content-center" style={{ height: "100%" }}>
        <Col md={8} className="text-center">
          <div className="d-flex flex-column align-items-center">
            <img 
              src={networkSecurityImage} 
              alt="Network Security" 
              className="img-fluid mb-4" 
              style={{ maxWidth: "200px" }} 
            />
            <Card className="shadow">
              <Card.Body>
                <Card.Title className="display-4">Network Security</Card.Title>
                <Card.Text className="lead">
                  Welcome to the Network Security category! Here you will find challenges related to network security.
                  <br />
                  Test your skills in identifying vulnerabilities, exploiting them, and securing network applications.
                </Card.Text>
                <Button variant="primary" size="lg">Start Challenges</Button>
              </Card.Body>
            </Card>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default NetworkSecurity;
